clc;
clear;
Tuning1 = load("Data/M6M5ID_Test1_actuation_uncompensated.mat");
Tuning1 = Tuning1.data;
%%
% Search for testing times via force plate z readings:
FPz = Tuning1{3}.Values;

Start_times = [];
End_times = [];
valid = false;
for i =1:length(FPz.Data)
    if valid
        if FPz.Data(i)>-5
            End_times = [End_times, FPz.Time(i)]; % Chop off the robot being picked up
            valid = false;
        end    
    else
        if FPz.Data(i)<-30
            Start_times = [Start_times, FPz.Time(i)];% Chop off the robot being put down
            valid = true;
        end
    end
end
End_times(5) = End_times(5) -10; % Strange artifact at the end of final sample - something went wring with lifting off the force plate.
%%
% Torques calculated via force plate forces using the jacobian, 

FPy = [];
FPz = [];
MRq = [];
MLq = [];
MRt_read = [];
MLt_read = [];
MRt_cmd = [];
MLt_cmd = [];
ts = 1000;
Start_times =int32(Start_times*ts);
End_times = int32(End_times*ts);



% Resamples
MR_q_resample = resample(Tuning1{5}.Values.q, Tuning1{1}.Values.Time);
ML_q_resample = resample(Tuning1{6}.Values.q, Tuning1{1}.Values.Time);
MR_t_resample = resample(Tuning1{5}.Values.t, Tuning1{1}.Values.Time);
ML_t_resample = resample(Tuning1{6}.Values.t, Tuning1{1}.Values.Time);
MR_t_cmd_resample = resample(Tuning1{9}.Values.tff, Tuning1{1}.Values.Time);
ML_t_cmd_resample = resample(Tuning1{8}.Values.tff, Tuning1{1}.Values.Time);
for i = 1:length(Start_times)
    % Force plate
    FPy = [FPy; Tuning1{2}.Values.Data(Start_times(i): End_times(i))];
    FPz = [FPz; Tuning1{3}.Values.Data(Start_times(i): End_times(i))];
    % Motor angles
    
    MRq = [MRq; MR_q_resample.Data(Start_times(i): End_times(i))];
    MLq = [MLq; ML_q_resample.Data(Start_times(i): End_times(i))];

    % Motor torques (cmd)
    
    MRt_cmd = [MRt_cmd; MR_t_cmd_resample.Data(Start_times(i): End_times(i))]; 
    MLt_cmd = [MLt_cmd; ML_t_cmd_resample.Data(Start_times(i): End_times(i))];
    
    % Motor torques (read)
   
    MRt_read = [MRt_read; MR_t_resample.Data(Start_times(i): End_times(i))];
    MLt_read = [MLt_read; ML_t_resample.Data(Start_times(i): End_times(i))];

end
clear MR_q_resample ML_q_resample MR_t_resample ML_t_resample MR_t_cmd_resample ML_t_cmd_resample

%%
%[text] ## Transfer force plate data into torques
% From the side of forces:
Fy_cmd = [];
Fz_cmd = [];
Fy_read = [];
Fz_read = [];
FP_tl = [];
FP_tr = [];
[J11, J12, J21, J22] = BalekaJacobianXY(MLq, MRq);
for i = 1:length(MLt_cmd)
    Jxy = [J11(i), J12(i); J21(i), J22(i)];
    JTxy = Jxy';

    FP_t = JTxy*[FPy(i); FPz(i)];
    FP_tl = [FP_tl, FP_t(1)];
    FP_tr = [FP_tr, FP_t(2)];

    F_cmd = JTxy\[MLt_cmd(i); MRt_cmd(i)];
    Fy_cmd = [Fy_cmd; -F_cmd(1)];
    Fz_cmd = [Fz_cmd; -F_cmd(2)];

    F_read = JTxy\[MLt_read(i)*9*0.198; MRt_read(i)*9*0.198];
    Fy_read = [Fy_read; -F_read(1)];
    Fz_read = [Fz_read; -F_read(2)];
end
clear F_cmd F_read i J11 J12 J22 J21 times ts JTxy Jxy

%%
x = [FP_tl, FP_tr];
y = [MLt_cmd; MRt_cmd]';
%Motor command compensation
plot(y, 'b'); %[output:262c67b7]
hold on %[output:262c67b7]
plot(x, 'r'); %[output:262c67b7]
legend("cmd", "meas") %[output:262c67b7]
hold off %[output:262c67b7]
% Line of best fit
%%
m1L_M6 = FP_tl(:)\MLt_cmd(:) %[output:518f41e9]
RsqL = corrcoef(FP_tl, MLt_cmd).^2 %[output:3d22205b]
percentErrorTorquesL = mean(abs((MLt_cmd' - FP_tl)./FP_tl)*100) %[output:7412b660]
MSETorquesLM6 = mean((MLt_cmd' - FP_tl).^2) %[output:8be4ae8d]
% [coeff, Sc] = polyfit(x,y, 1);
xFitL = linspace(min(FP_tl), max(MLt_cmd), 1000);
yFitL = polyval([m1L_M6 0], xFitL);


scatter(FP_tl, MLt_cmd, 'b','filled') %[output:53e6dcf1]
hold on %[output:53e6dcf1]
plot(xFitL, yFitL, 'r-', LineWidth=2) %[output:53e6dcf1]
title("Measured vs commanded torque for the Left motor (M6)"); %[output:53e6dcf1]
ylabel("Motor commanded torque (Nm)"); %[output:53e6dcf1]
xlabel("Force plate measured torque (Nm)"); %[output:53e6dcf1]
legend("Measured data", "Line of best fit") %[output:53e6dcf1]
axis([0 40 -inf inf]) %[output:53e6dcf1]
hold off %[output:53e6dcf1]

m1R_M5 = FP_tr(:)\MRt_cmd(:) %[output:551a2117]
RsqR = corrcoef(FP_tr, MRt_cmd).^2 %[output:08636189]
percentErrorTorquesR = mean(abs((MRt_cmd' - FP_tr)./FP_tr)*100) %[output:49d65469]
MSETorquesRM5 = mean((MRt_cmd' - FP_tr).^2) %[output:1236a2ec]
% [coeff, Sc] = polyfit(x,y, 1);
xFitR = linspace(min(FP_tr), max(MRt_cmd), 1000);
yFitR = polyval([m1R_M5 0], xFitR);


scatter(FP_tr, MRt_cmd, 'b','filled') %[output:3df0805b]
hold on %[output:3df0805b]
plot(xFitR, yFitR, 'r-', LineWidth=2) %[output:3df0805b]
title("Measured vs commanded torque for the Right motor (M5)"); %[output:3df0805b]
ylabel("Motor commanded torque (Nm)"); %[output:3df0805b]
xlabel("Force plate measured torque (Nm)"); %[output:3df0805b]
legend("Measured data", "Line of best fit") %[output:3df0805b]
axis([-40 0 -inf inf]) %[output:3df0805b]
hold off %[output:3df0805b]
% m2 = coeff(1)
% c2 = coeff(2)
% %where line of best fit is y=mx +c
% Sc
%%
t1 = 60000;
t2 = 70000;
linwidth = 1.5;
t = linspace(0, length(FPz(t1:t2))/1000, length(FPz(t1:t2)));
plot(t, Fz_cmd(t1: t2), LineWidth=linwidth, LineStyle='-', Color='#DDAA33')
hold on
plot(t, -FPz(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#BB5566')
plot(t, Fz_read(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#004488' )
legend('Leg commanded force', 'Force plate measurement', 'Motor force sensing');
title('Original (uncompensated) Vertical forces')

xlabel("Time (s)")
ylabel("Force (N)")
hold off


%%
tiledlayout(2,2)
nexttile
scatter(-FPz, Fz_cmd, 1, 'b', 'filled')
hold on
title("Measured vs commanded vertical force");
ylabel("Commanded vertical force (N)");
xlabel("Force plate measured vertical force (N)");
hold off

nexttile
scatter(-FPy, Fy_cmd, 1, 'b', 'filled')
hold on
title("Measured vs commanded horizontal force");
ylabel("Commanded horizontal force (N)");
xlabel("Force plate measured horizontal force (N)");
hold off

nexttile
scatter(-FPz, Fz_read, 1, 'b', 'filled')
hold on
title("Measured vs sensed (via motors) vertical force");
ylabel("Motor measured vertical force (N)");
xlabel("Force plate measured vertical force (N)");
hold off

nexttile
scatter(-FPy, Fy_read, 1, 'b', 'filled')
hold on
title("Measured vs sensed (via motors) horizontal force");
ylabel("Motor measured horizontal force (N)");
xlabel("Force plate measured horizontal force (N)");
hold off

%%
t1 = 60000;
t2 = 70000;
linwidth = 1.5;
t = linspace(0, length(FPz(t1:t2))/1000, length(FPz(t1:t2)));
plot(t, Fy_cmd(t1: t2), LineWidth=linwidth, LineStyle='-', Color='#DDAA33')
hold on
plot(t, -FPy(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#BB5566')
plot(t, Fy_read(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#004488' )
legend('Leg commanded force', 'Force plate measurement', 'Motor force sensing');
title('Original (uncompensated) Horizontal forces')

xlabel("Time (s)")
ylabel("Force (N)")
hold off

